```json
{
  "application": "OAR",
  "details": {
    "resource_requirements": {
      "nodes": 1,
      "walltime": "30:00:00"
    },
    "modules": [
      "conda/2020.11-python3.8"
    ],
    "conda_environment": "myenv",
    "python_script": "create_st.py"
  }
}
```

**Explanation:**

* **Application:** The script utilizes the **OAR (Open Application Resource)** resource management system. 
* **Details:** 
    * **Resource Requirements:** This script requests one node and a maximum runtime of 30 hours.
    * **Modules:** It loads the conda environment with version 2020.11, specifically for Python 3.8.
    * **Conda Environment:** The script activates a conda environment named "myenv".
    * **Python Script:**  The script runs a Python script called "create_st.py", passing an argument represented by `$1`.
